event39= Event.create!(user_id: user20.id, group_id: group4.id, name: "Looking for volunteers for an annual fundrasing event for foster children", description: "An annual fundraiser is looking for volunteers to help with our cause! I am a volunteer CASA (Court Appointed Special Advocate) for foster children in the Bay Area. Through my time as a one-on-one mentor for foster children, I have learned about the struggle and hardship that they experience and the importance of having a reliable adult in their lives. Because of this, I started the annual Archangel Holiday Boutique to raise funds for Bay Area foster children, to spread the word about the work of CASAs, and to recruit more child advocates.
The next Archangel Holiday Boutique is on October 7th and 8th. We are looking for volunteers with a variety of skills and hours of participation:
Tech support: Update and maintain website and social media accounts like Facebook and Instagram. 5-10 hours/month until mid-October.
General support: Distribution of flyers and posters, on-line ad and event calendar listing, contacting media outlets (TV, radio, and magazines), 5-10 hours/month until Oct 6h.
Event site preparation, and event support as receptionist, greeter, gift-wrapper, etc., Any number of hours on Oct 7th and 8th.", location: "Cupertino", start_time: DateTime.parse('2017-11-15 08:00 GMT-7'), end_time: DateTime.parse('2017-11-15 19:00 GMT-7'))

